import { link } from "fs";
import React from "react";
import Todo from "../models/todo";
import TodoItem from "../components/TodoItem";

const Todos: React.FC<{ items: Todo[] }> = (props) => {
  return (
    <ul>
      {props.items.map((item) => (
        <li key={item.id}>
          <TodoItem text={item.text} />
        </li>
      ))}
    </ul>
  );
};

export default Todos;
